import React from 'react';
import {
	FooterContainer,
	FooterSection,
	FooterWrapper,
	IconWrapper,
	PaypalIcon,
	Waves,
} from './footer.styles';

const Footer = () => {
	const footerData = [
		{
			title: 'Section One',
			content: ['Content One', 'Content Two', 'Content Three'],
		},
		{
			title: 'Section Two',
			content: ['Content One', 'Content Two', 'Content Three'],
		},
		{
			title: 'Section Three',
			content: ['Content One', 'Content Two', 'Content Three'],
		},
	];
	return (
		<div>
			<Waves />
			<FooterContainer>
				<IconWrapper>
					<PaypalIcon />
				</IconWrapper>
				<IconWrapper>
					<PaypalIcon />
				</IconWrapper>
				<FooterWrapper>
					{footerData.map((item) => (
						<FooterSection>
							<h3 className="header">{item.title}</h3>
							{item.content.map((sec) => (
								<div className="content" key={sec}>
									{sec}
								</div>
							))}
						</FooterSection>
					))}
				</FooterWrapper>
			</FooterContainer>
		</div>
	);
};

export default Footer;
